import React from "react";
import AddIcon from '@mui/icons-material/Add';

function HeadTag(props) {

    const style = {
        "text-align": "left",
        "padding-top": "8%"
    };

    // const multiColorText = {
    //         "background-image": "linear-gradient(to right, SlateBlue, grey, green)",
    //         "-webkit-background-clip": "text",
    //         "-moz-background-clip": "text",
    //         "background-clip": "text",
    //         "color": "transparent"
    // }

  return (
    <div>

        <div class="top-down">

          <nav class="navbar navbar-expand-lg" id="top-navbar" style={style}>
            <div class="collapse navbar-collapse" id="navbarNav">
                <a href="!#" class="nav-link"> <AddIcon/> <p>Add a work!</p> </a>
                <h2> {props.Title} </h2> 
            </div>

          </nav>

        </div>

    </div>

  );
}

export default HeadTag;
